import MainCharacterSelection from './components/MainCharacterSelection'
import Footer from './components/Footer'

function App() {
	return (
		<div className='App'>
			<Header />
			<HomeSearch />
			<MainCharacterSelection />
			<Footer />
		</div>
	);
}

export default App;
